import React from 'react'
import Grid from '@material-ui/core/Grid';
import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';



const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper:{
        background:"transparent"
    }

}))


const Aboutus = () => {
   const classes=useStyles()
   
    return (
        <>
         <div className={classes.root} >
        <Grid container  
         justifyContent="center"
         alignItems="center"



>

           

            <Grid item md={6} >

                <Paper className={classes.Paper} elevation={0}>
                    <Typography  style={{fontWeight:700,textAlign:"center"}} component="h3">
                        ABOUT US 
                     </Typography>

                     <Typography style={{textAlign:"center"}} >Sunset Ludge</Typography>
                     <Typography style={{textAlign:"center"}}  >Lorem, ipsum dolor sit amet consectetur
                      adipisicing elit. Animi natus quasi quam alias quos libero cumque!
                       Quia modi quibusdam voluptates neque optio molestiae commodi, distinctio iure!
                        Quod hic delectus accusamus.</Typography>
                </Paper>

                <Button color="primary">Read More</Button>


                </Grid>

                <Grid item >
                    <div>

                    <img src="image/about.jpg" alt="" />

                    </div>

                    </Grid>


            </Grid>

            </div>




        </>
    )
}

export default Aboutus
